import styled from "styled-components"
import { Image, Content, Description, Title } from "../components/modules"

const ThirdPage = () => {
  return (
    <Background id="3">
      <Content>
        <Title>모티를 키우려면?</Title>
        <Description>
          모티의 성장을 위해서는 밥이 필요해요!
          <br />
          깃허브 커밋을 통해 밥그릇을 채워주세요. 선택한 레포지토리들의
          커밋으로만 밥그릇을 채울 수 있다는 점! 밥주기 버튼을 누르면 모티가
          밥을 먹고 성장해요.
        </Description>
      </Content>
      <Image src="images/grow.png" alt="grow" />
    </Background>
  )
}

export default ThirdPage

const Background = styled.div`
  height: 67vh;
  background: white;
  display: flex;
  align-items: center;
  justify-content: space-evenly;
`
